import LoginForm from './components/LoginForm';
import RegisterForm from './components/RegisterForm';
import { Redirect } from "react-router-dom";
function App() {


  return (

    localStorage.getItem('__sessionToken') ?
      <div>
        <Redirect to={"/login"} />
        <LoginForm /> </div>
      : <RegisterForm />

  )
}

export default App;
